--
-- 网站数据库"hjz_cms"备份内容！
--


-- ----------------------------------------

DROP TABLE IF EXISTS `#_actor`;
CREATE TABLE `#_actor` (`sort_num` double NULL ,
`id` int(11) NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`identifier` varchar(20) NULL , INDEX(`identifier`),
`description` text NULL ,
`rights` text NULL ,
`top` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`top`),
`edit_time` int(11) NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=5 comment='系统管理者类型';
DROP TABLE IF EXISTS `#_address`;
CREATE TABLE `#_address` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`phone` varchar(20) NULL ,
`content` text NULL ,
`code` varchar(50) NULL ,
`member_id` varchar(255) NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=1 comment='收货地|收货地信息模块';
DROP TABLE IF EXISTS `#_article`;
CREATE TABLE `#_article` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`identifier` varchar(50) NULL , INDEX(`identifier`),
`seo_keywords` varchar(255) NULL ,
`seo_desc` varchar(255) NULL ,
`parent_id` varchar(255) NOT NULL ,
`cat_names` varchar(255) NOT NULL ,
`description` text NULL ,
`content` text NULL ,
`image_path` varchar(255) NULL ,
`total_visits` int(20) unsigned NULL DEFAULT '0' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`weibsite_id` int(11) NOT NULL DEFAULT '1' ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=8 comment='文章|文章信息模块';
DROP TABLE IF EXISTS `#_banner`;
CREATE TABLE `#_banner` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`jump_url` varchar(255) NULL ,
`description` text NULL ,
`image_path` varchar(255) NULL ,
`website_id` int(11) NOT NULL DEFAULT '1' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=10 comment='大图展示|宣传、展示类大图';
DROP TABLE IF EXISTS `#_cart`;
CREATE TABLE `#_cart` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`goods_id` int(11) NULL ,
`price` double NULL ,
`number` int(11) NULL ,
`fee` double NULL ,
`other_info` text NULL ,
`parent_id` int(11) NULL ,
`status` tinyint(4) NULL DEFAULT '1' ,
`order_num` char(16) NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=1 comment='购物车|购物车模块';
DROP TABLE IF EXISTS `#_category`;
CREATE TABLE `#_category` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`identifier` varchar(255) NULL , INDEX(`identifier`),
`parent_id` int(11) NOT NULL DEFAULT '-1' ,
`parent_path` varchar(255) NULL ,
`description` text NULL ,
`image_path` varchar(255) NULL ,
`website_id` int(11) NOT NULL DEFAULT '1' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '1' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=13 comment='信息分类|后台信息分类模块';
DROP TABLE IF EXISTS `#_comment`;
CREATE TABLE `#_comment` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`content` text NOT NULL ,
`item_id` int(11) NOT NULL ,
`model` varchar(50) NOT NULL ,
`parent_id` int(11) NOT NULL ,
`reply_to` int(10) unsigned NOT NULL DEFAULT '0' ,
`pass` enum('是','否') NOT NULL DEFAULT '是' , INDEX(`pass`),
`hash` char(32) NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=210 comment='评论|用户评论信息模块';
DROP TABLE IF EXISTS `#_company`;
CREATE TABLE `#_company` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`site_name` varchar(255) NOT NULL , INDEX(`site_name`),
`image_path` varchar(255) NULL ,
`seo_keywords` varchar(255) NULL ,
`seo_desc` varchar(255) NULL ,
`description` text NULL ,
`content` text NULL ,
`administrator` varchar(255) NOT NULL ,
`qq` varchar(50) NULL ,
`weibo` varchar(150) NULL ,
`weixin` varchar(255) NULL ,
`wangwang` varchar(255) NULL ,
`email` varchar(50) NOT NULL ,
`phone` varchar(50) NULL ,
`fax` varchar(50) NULL ,
`address` varchar(255) NULL , INDEX(`address`),
`copyright` varchar(255) NULL ,
`website_id` int(11) NOT NULL DEFAULT '1' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=2 comment='公司信息|公司信息管理模块';
DROP TABLE IF EXISTS `#_config`;
CREATE TABLE `#_config` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`site_name` varchar(255) NOT NULL , INDEX(`site_name`),
`image_path` varchar(255) NULL ,
`seo_keywords` varchar(255) NULL ,
`seo_desc` varchar(255) NULL ,
`administrator` varchar(255) NOT NULL ,
`qq` varchar(50) NULL ,
`email` varchar(50) NOT NULL ,
`phone` varchar(50) NULL ,
`fax` varchar(50) NULL ,
`weibo` varchar(150) NULL ,
`address` varchar(255) NULL , INDEX(`address`),
`copyright` varchar(255) NOT NULL ,
`website_id` int(11) NOT NULL DEFAULT '1' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=3 comment='网站信息配置|网站信息配置';
DROP TABLE IF EXISTS `#_feed`;
CREATE TABLE `#_feed` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`parent_id` int(11) NOT NULL ,
`content` varchar(255) NOT NULL ,
`item_id` int(11) NOT NULL ,
`status` tinyint(4) unsigned NOT NULL DEFAULT '1' ,
`type` tinyint(4) NOT NULL DEFAULT '4' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=61 comment='系统消息|系统消息模块';
DROP TABLE IF EXISTS `#_goods`;
CREATE TABLE `#_goods` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`seo_keywords` varchar(255) NULL ,
`seo_desc` varchar(255) NULL ,
`parent_id` int(11) NOT NULL DEFAULT '-1' ,
`us_price` double NOT NULL DEFAULT '0' ,
`hk_price` double NOT NULL DEFAULT '0' ,
`quantity` int(10) unsigned NOT NULL DEFAULT '0' ,
`start_time` datetime NULL ,
`end_time` datetime NULL ,
`total_like` int(11) NOT NULL DEFAULT '0' ,
`size` varchar(255) NULL ,
`description` text NULL ,
`content` text NULL ,
`album_hash` char(32) NOT NULL ,
`image_path` varchar(255) NULL ,
`is_best` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`is_best`),
`total_visits` bigint(20) NOT NULL DEFAULT '0' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) unsigned NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=5 comment='商品|商品信息管理';
DROP TABLE IF EXISTS `#_hash`;
CREATE TABLE `#_hash` (`id` int(11) NOT NULL auto_increment PRIMARY KEY,
`hash` char(32) NOT NULL ,
`parent_id` int(11) NOT NULL DEFAULT '0' ,
`end_time` int(10) unsigned NOT NULL DEFAULT '0' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=18 comment='';
DROP TABLE IF EXISTS `#_lang`;
CREATE TABLE `#_lang` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`parent_id` int(11) NULL DEFAULT '-1' ,
`mask_id` int(255) NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(10) unsigned NOT NULL DEFAULT '1' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=1105 comment='语言|语言信息';
DROP TABLE IF EXISTS `#_langmask`;
CREATE TABLE `#_langmask` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`has_tpl` tinytext NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=402 comment='语言标识|语言标识模块';
DROP TABLE IF EXISTS `#_langtype`;
CREATE TABLE `#_langtype` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`parent_id` int(11) NULL DEFAULT '-1' ,
`identifier` varchar(30) NOT NULL , INDEX(`identifier`),
`description` text NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=4 comment='语言种类|语言种类信息';
DROP TABLE IF EXISTS `#_link`;
CREATE TABLE `#_link` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`jump_url` varchar(255) NOT NULL ,
`description` varchar(255) NULL ,
`image_path` varchar(255) NULL ,
`top` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`top`),
`total_visits` bigint(20) NULL DEFAULT '0' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=3 comment='友情链接|收集好友的网站，提供网站导航';
DROP TABLE IF EXISTS `#_linkeddata`;
CREATE TABLE `#_linkeddata` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL ,
`res_id` varchar(255) NOT NULL , INDEX(`res_id`),
`parent_id` int(11) NOT NULL ,
`description` varchar(255) NULL ,
`hash` char(32) NOT NULL , INDEX(`hash`),
`is_cover` enum('是','否') NOT NULL DEFAULT '否' ,
`folder` int(11) NOT NULL DEFAULT '0' ,
`model` varchar(50) NOT NULL , INDEX(`model`),
`top` enum('是','否') NOT NULL DEFAULT '否' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=223 comment='关联数据|信息项目与资源的关联关系表';
DROP TABLE IF EXISTS `#_log`;
CREATE TABLE `#_log` (`IP` varchar(255) NOT NULL , INDEX(`IP`),
`url` varchar(255) NULL ,
`broswer` text NULL ,
`action` varchar(50) NULL , INDEX(`action`),
`model` varchar(50) NULL , INDEX(`model`),
`id` int(11) NOT NULL auto_increment, INDEX(`id`)
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=1 comment='访问日志|系统访问日志';
DROP TABLE IF EXISTS `#_message`;
CREATE TABLE `#_message` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`parent_id` int(11) NOT NULL DEFAULT '1' ,
`visitor` varchar(20) NULL ,
`qq` varchar(15) NULL ,
`phone` varchar(50) NULL ,
`email` varchar(50) NULL ,
`content` text NULL ,
`pass` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`pass`),
`top` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`top`),
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '-1' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=5 comment='访客留言|访客的疑问或是意见反馈';
DROP TABLE IF EXISTS `#_modelmanager`;
CREATE TABLE `#_modelmanager` (`sort_num` double unsigned NULL ,
`id` int(11) NOT NULL auto_increment PRIMARY KEY,
`name` varchar(50) NOT NULL ,
`identifier` varchar(30) NULL ,
`description` varchar(255) NULL ,
`parent_id` int(11) NULL ,
`on_desktop` enum('是','否') NULL DEFAULT '是' ,
`image_path` varchar(255) NULL ,
`top` enum('是','否') NOT NULL DEFAULT '否' ,
`pass` enum('是','否') NOT NULL DEFAULT '是' ,
`edit_time` int(11) NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=262 comment='框架核心表，用来存储当前模块信息。';
DROP TABLE IF EXISTS `#_navmenu`;
CREATE TABLE `#_navmenu` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`jump_url` varchar(255) NULL ,
`parent_id` int(11) NOT NULL DEFAULT '-1' ,
`description` text NULL ,
`top` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`top`),
`website_id` int(11) NOT NULL DEFAULT '1' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '-1' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=41 comment='导航菜单|网站导航菜单信息。';
DROP TABLE IF EXISTS `#_order`;
CREATE TABLE `#_order` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`code` char(14) NOT NULL ,
`name` varchar(50) NOT NULL , INDEX(`name`),
`parent_id` int(11) NOT NULL DEFAULT '1' ,
`phone` varchar(20) NULL ,
`email` varchar(50) NULL ,
`url` varchar(255) NOT NULL ,
`goods_name` varchar(255) NOT NULL ,
`price` varchar(255) NOT NULL ,
`color` varchar(255) NOT NULL ,
`size` varchar(255) NOT NULL ,
`number` int(11) NOT NULL DEFAULT '0' ,
`category` varchar(255) NOT NULL ,
`comment` varchar(255) NULL ,
`image_path` varchar(255) NULL ,
`hash` char(32) NOT NULL ,
`status` tinyint(4) NOT NULL DEFAULT '1' ,
`need_next` enum('是','否') NOT NULL DEFAULT '否' ,
`edit_time` int(11) NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '0' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=12 comment='用户订单|用户订单信息模块';
DROP TABLE IF EXISTS `#_relationship`;
CREATE TABLE `#_relationship` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`type` tinyint(4) NOT NULL DEFAULT '1' ,
`item_id` int(11) NOT NULL ,
`rel_id` int(11) NOT NULL ,
`folder` int(11) NOT NULL DEFAULT '0' ,
`model` varchar(50) NOT NULL DEFAULT 'article' , INDEX(`model`),
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=134 comment='外键关联|数据外键关联信息表';
DROP TABLE IF EXISTS `#_resource`;
CREATE TABLE `#_resource` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`path` varchar(255) NOT NULL ,
`type` varchar(20) NOT NULL ,
`fhash` char(40) NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=63 comment='文件资源|文件、图片等资源管理';
DROP TABLE IF EXISTS `#_rights`;
CREATE TABLE `#_rights` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`identifier` varchar(50) NULL , INDEX(`identifier`),
`parent_id` int(11) NOT NULL DEFAULT '-1' ,
`app` varchar(255) NULL ,
`description` text NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '-1' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=253 comment='权限资源|权限资源管理';
DROP TABLE IF EXISTS `#_tags`;
CREATE TABLE `#_tags` (`sort_num` double unsigned NULL , INDEX(`sort_num`),
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`hots` int(11) NOT NULL DEFAULT '0' ,
`top` enum('是','否') NOT NULL DEFAULT '否' , INDEX(`top`),
`author` int(11) NOT NULL DEFAULT '1' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=467 comment='标签|标签信息管理';
DROP TABLE IF EXISTS `#_tpl`;
CREATE TABLE `#_tpl` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`app` varchar(50) NOT NULL ,
`hash` char(32) NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(10) unsigned NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=234 comment='模板|系统里的模板';
DROP TABLE IF EXISTS `#_tpl_lang`;
CREATE TABLE `#_tpl_lang` (`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`tpl_id` int(11) NOT NULL , INDEX(`tpl_id`),
`mask_id` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=1880 comment='模板语言标识关系模板语言标识关系模块';
DROP TABLE IF EXISTS `#_user`;
CREATE TABLE `#_user` (`sort_num` int(10) unsigned NULL ,
`id` int(11) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(50) NOT NULL , INDEX(`name`),
`password` char(32) NULL ,
`sex` tinyint(4) NOT NULL DEFAULT '1' ,
`age` varchar(20) NOT NULL DEFAULT '0' ,
`birthday` date NOT NULL ,
`parent_id` int(11) NOT NULL DEFAULT '1' ,
`description` varchar(255) NULL ,
`image_path` varchar(255) NULL ,
`qq` varchar(20) NULL ,
`email` varchar(50) NULL ,
`phone` varchar(30) NULL ,
`hash` varchar(60) NULL ,
`pass` enum('是','否') NOT NULL DEFAULT '是' , INDEX(`pass`),
`edit_time` int(11) NOT NULL ,
`ip` char(32) NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '0' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=19 comment='网站的用户列表';
DROP TABLE IF EXISTS `#_userinfo`;
CREATE TABLE `#_userinfo` (`id` int(11) NOT NULL auto_increment PRIMARY KEY,
`share` int(10) unsigned NOT NULL DEFAULT '0' ,
`watched` int(10) unsigned NOT NULL DEFAULT '0' ,
`followed` int(10) unsigned NOT NULL DEFAULT '0' ,
`tags` varchar(255) NULL ,
`school` varchar(100) NULL , INDEX(`school`),
`department` varchar(100) NULL , INDEX(`department`),
`class` varchar(50) NULL , INDEX(`class`),
`birthday` char(10) NULL ,
`parent_id` int(11) NOT NULL ,
`url` varchar(255) NULL ,
`location` varchar(255) NULL ,
`city` int(11) NULL ,
`province` int(11) NULL ,
`edit_time` int(11) NOT NULL ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=7 comment='用户附加信息|如：学校、系部、班级等';
DROP TABLE IF EXISTS `#_website`;
CREATE TABLE `#_website` (`sort_num` double unsigned NULL ,
`id` tinyint(3) unsigned NOT NULL auto_increment PRIMARY KEY,
`name` varchar(255) NOT NULL , INDEX(`name`),
`identifier` varchar(50) NULL , INDEX(`identifier`),
`enable` enum('是','否') NOT NULL DEFAULT '是' ,
`description` text NULL ,
`lang_type` char(5) NOT NULL DEFAULT 'zh-cn' ,
`create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
`author` int(11) NOT NULL DEFAULT '-1' 
)engine=MyISAM DEFAULT CHARSET=utf8 auto_increment=11 comment='网站管理|平台所有网站管理';

